import React from "react";
const About = () => {
  return (
    <div id="about" className="about_me">
      <div className="container py-5">
        <h2>
          <span className="about">About</span> Me
        </h2>
        <p>
          Hello! I am Krishna Sai Surendra Kalluri, a talented Front End
          Engineer with a passion for building cutting-edge web and mobile
          applications using React.js and React-Native frameworks. With an
          extensive knowledge of HTML5, CSS3, JavaScript, React/Redux, Redux
          Saga, ES6, jQuery, Bootstrap, NodeJS, Styled Components, SASS/LESS CSS
          Preprocessors, and RESTful web services, I am a versatile and skilled professional who has proven my expertise time and again.
        </p>
        <br />
        <p>
        I am a self-driven individual who is always eager to learn and explore new things. I possess a sharp mind and can quickly adapt to changing trends and technologies in the industry. With my ability to think out of the box and a keen eye for detail, I am capable of building constructive and efficient solutions that can meet the unique needs of my clients.
        </p>

      </div>
    </div>
  );
};

export default About;
